import React from 'react';


class Size extends React.Component {
    render() {
        return (
            <label class="size_label">
                <input onClick={this.props.handleSizeChange} type="radio" name="size" value={this.props.size} key={this.props.size}/>
                <span>{this.props.size}</span>
            </label>
        )
    }
}


const SizeList = props => {
console.log(props)
    return (
            props.sizes.map((size) => {
                <Size size={size} handleSizeChange={props.handleSizeChange}/>
            })
        )
}
export default SizeList;
